import React from 'react'

const TableHeader = () => {
    return (
        <thead>
            <tr>
                <th>Ranking</th>
                <th>Listing Id</th>
                <th>Make</th>
                <th>Selling Price</th>
                <th>Mileage</th>
                <th>Total amount of contacts</th>
            </tr>
        </thead>
    );
}

const TableBody = ({value}) => {
    const rows = props.characterData.map((row, index) => {
        return (
            <tr >
                <td>{value.Ranking}</td>
                <td>{value.ListingId}</td>
                <td>{value.Make}</td>
                <td>{value.SellingPrice}</td>
                <td>{value.Mileage}</td>
                <td>{value.NumberOfContacts}</td>
            </tr>
        );
    });
}

const Top5PerMonth = ({ top5PerMonth }) => {
    return (
        <div>
            <center><h1>The top 5 most contacted listings per Month</h1></center>
            <div className="card">
                {
                    Object.entries(top5PerMonth).map(([key, values]) => (
                        <div className="card-body">
                            <h5 className="card-title">Month: {key}</h5>
                            {values.map((value) => (
                                <div>
                                    <p className="card-text">{value.Ranking}</p>
                                    <p className="card-text">{value.ListingId}</p>
                                    <p className="card-text">{value.Make}</p>
                                    <p className="card-text">{value.Mileage}</p>
                                </div>
                            ))}
                        </div>
                    ))
                }
            </div>
        </div>
    )
};

export default Top5PerMonth
